@EU_Commission Here's a symbolic bit of info.
Every railway station in France had posters displayed around the anniversary to set out what's in the ECFR and in this tweet.
In England I never saw mention of it (except for the entirely inaccurate case of it being a reason to leave the EU).

@EU_Commission This video is blatant propaganda in old USSR style.
It seeks to disinform the public and spread lies.
It also is an abuse of tax payer money..
